import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import ReactTooltip from "react-tooltip";

class ChangeSpeed extends React.Component {
  render() {
    return (
      <li>
        <div className="dropdown is-up">
          <div className="dropdown-trigger">
            {" "}
            <a
              data-tip="Change Speed"
              style={{
                cursor: "pointer"
              }}
            >
              <FontAwesomeIcon icon="tachometer-alt" />
            </a>
            <ReactTooltip place="top" type="dark" effect="float" />{" "}
          </div>
          <div className="dropdown-menu" id="dropdown-menu7" role="menu">
            <div className="dropdown-content">
              <div className="dropdown-item">1</div>
              <div className="dropdown-item">2</div>
            </div>
          </div>
        </div>
      </li>
    );
  }
}

export default ChangeSpeed;
